() => {
      cy.visit(url);
      cy.wait(1000);
      cy.get("#fetch-employees").click();
      cy.wait(1000);
      cy.get("#main-section").contains('Abram Langtry');
      cy.then(() => {
        acc_score += 2;
      });
    }

() => {
      //////////////
      console.log(acc_score);
      let result = {
        id,
        marks: Math.floor(acc_score)
      };
      result = JSON.stringify(result);
      cy.writeFile("results.json", `\n${result},`, {
        flag: "a+"
      }, err => {
        if (err) {
          console.error(err);
        }
      }); //////////////////
    }
